import React, {Component} from 'react';
import '../css/TopNav.scss';

const TopNav = () => {
    return (
        <nav>
            <ul>
                <li>Bio</li>
                <li>Work</li>
                <li>Resume</li>
                <li>Contact</li>
            </ul>
        </nav>
    );
};
export default TopNav;
